import { Link } from 'react-router-dom';
import { header } from '../../api/api';

export const Title = () => {
    return (
        <div className="row">
                <div className="col-lg-10 col-md-10 col-sm-8">
                    <h1>{header.listUser.title}</h1>
                </div>
                <div className="col-lg-2 col-md-2 col-sm-4">
                    <div className="d-grid gap-2">
                        <Link to="../user" className="btn btn-primary" role={"button"}>
                            Add User
                        </Link>
                    </div>
                </div>
            </div>
    )
}
